import React from "react";

const Header = () => {
  return (
    <div className="header">
      <h1>Learn code</h1>
      <ul>
        <li>
          <a href="http://">home</a>
        </li>
        <li>
          <a href="http://">faq</a>
        </li>

        <a href="http://">contact</a>
      </ul>
    </div>
  );
};

export default Header;
